define(['jquery', 'core/config','core/notification', 'local_newsvnr/VnRloader_moment','local_newsvnr/VnRloader_daterangepicker'], function ($, Config, Notification, moment, daterangepicker) {
	
	function initManage() {
		$('input[name="daterange"]').daterangepicker({
		    opens: 'left'
		  }, function(start, end, label) {
		    console.log("A new date selection was made: " + start.format('YYYY-MM-DD') + ' to ' + end.format('YYYY-MM-DD'));
		  });
	}
	
	return {
		init: function () {
			initManage();
		}
	};
});

